import React from "react";
import InputForm from "./components/InputForm";

function App() {
  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Student Performance Prediction</h1>
      <p style={styles.subtitle}>
        Enter student details below to predict the final grade (A/B/C/D)
      </p>

      {/* Input Form Component */}
      <InputForm />
    </div>
  );
}

// Inline styling (optional)
const styles = {
  container: {
    maxWidth: "700px",
    margin: "auto",
    padding: "20px",
    textAlign: "center",
    fontFamily: "Arial, sans-serif",
  },
  title: {
    fontSize: "32px",
    marginBottom: "10px",
  },
  subtitle: {
    fontSize: "16px",
    color: "#555",
    marginBottom: "20px",
  },
};

export default App;
